import styled from "styled-components";
import { Card } from "@mui/material";

export const TableCard = styled(Card)`
  table {
    thead {
      th {
        color: #7c7c7c;
        font-size: 15px;
        font-weight: 400;
        line-height: 22.5px;
        .Mui-active {
          color: #7c7c7c;
        }
        input{
          background: #F8F8F8;
        }
      }
    }
  }
`;
